import React, { Component } from "react";
import { connect } from "react-redux";
import Dialog from "./Dialog";
import Footer from "./Footer";
import * as quiers from "./../actions/queries";

class Users extends Component {
  componentDidMount() {
    var interval = setInterval(() => {
      this.getMembers();
    }, 5000);
  }

  getMembers() {
    this.props.getMembers(this.props.userId);
  }

  render() {
    return (
      <div class="row">
        <div className="container">
          <h1>Currently memebers</h1>
          <div>
            {this.props.members
              ? this.props.members.map(member => (
                  <div
                    class="col errp card"
                    style={{ margin: "0rem", width: "100%", padding: "1rem" }}
                  >
                    <div style={{ width: "100%" }}>
                      <label> First Name</label>
                      <h6>{member.first_name}</h6>
                    </div>
                    <div>
                      <label> email</label>
                      <br />
                      <span>{member.email}</span>
                    </div>
                  </div>
                ))
              : null}
          </div>
        </div>
      </div>
    );
  }
}

Users.propTypes = {};

function mapDispatchToProps(dispatch) {
  return {
    getMembers: id => dispatch(quiers.getMembers(id))
  };
}

function mapStateToProps(state) {
  return {
    members: state.user.allMembers,
    userId: state.user.profile.id
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Users);
